import { View, Text } from 'react-native'
import React from 'react'
import Ionicons from '@expo/vector-icons/Ionicons';

const Third = () => {
  return (
    <View>
      <Text>Third</Text>
      <Ionicons name="qr-code-outline" size={22} color='#eccf13'></Ionicons>
    </View>
  )
}

export default Third
